import React from "react";
import './Sass/style.scss'
import Header from './Components/Header/Header'
import Banner from "./Components/Banner/Banner";
import Readey from "./Components/Readey/Readey";
function App() {
  return (
    <div className="App">
      <Header />
      <Banner/>
      <Readey/>
    </div>
  );
}

export default App;
